import{r as o,o as e,c as n,a as s,b as a,w as t,F as p,d as c,e as l}from"./app.e50d7488.js";const u={},r=c('<h1 id="dokodemo-door" tabindex="-1"><a class="header-anchor" href="#dokodemo-door" aria-hidden="true">#</a> Dokodemo-Door</h1><p>Dokodemo door（任意门）可以监听一个本地端口，并把所有进入此端口的数据发送至指定服务器的一个端口，从而达到端口映射的效果。</p><h2 id="inboundconfigurationobject" tabindex="-1"><a class="header-anchor" href="#inboundconfigurationobject" aria-hidden="true">#</a> InboundConfigurationObject</h2><div class="language-json ext-json line-numbers-mode"><pre class="language-json"><code><span class="token punctuation">{</span>\n  <span class="token property">&quot;address&quot;</span><span class="token operator">:</span> <span class="token string">&quot;8.8.8.8&quot;</span><span class="token punctuation">,</span>\n  <span class="token property">&quot;port&quot;</span><span class="token operator">:</span> <span class="token number">53</span><span class="token punctuation">,</span>\n  <span class="token property">&quot;network&quot;</span><span class="token operator">:</span> <span class="token string">&quot;tcp&quot;</span><span class="token punctuation">,</span>\n  <span class="token property">&quot;timeout&quot;</span><span class="token operator">:</span> <span class="token number">0</span><span class="token punctuation">,</span>\n  <span class="token property">&quot;followRedirect&quot;</span><span class="token operator">:</span> <span class="token boolean">false</span><span class="token punctuation">,</span>\n  <span class="token property">&quot;userLevel&quot;</span><span class="token operator">:</span> <span class="token number">0</span>\n<span class="token punctuation">}</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br></div></div><blockquote><p><code>address</code>: address</p></blockquote><p>将流量转发到此地址。可以是一个 IP 地址，形如 <code>&quot;1.2.3.4&quot;</code>，或者一个域名，形如 <code>&quot;xray.com&quot;</code>。字符串类型。</p><p>当 <code>followRedirect</code>（见下文）为 <code>true</code> 时，<code>address</code> 可为空。</p><blockquote><p><code>port</code>: number</p></blockquote><p>将流量转发到目标地址的指定端口，范围 [1, 65535]，数值类型。必填参数。</p><blockquote><p><code>network</code>: &quot;tcp&quot; | &quot;udp&quot; | &quot;tcp,udp&quot;</p></blockquote><p>可接收的网络协议类型。比如当指定为 <code>&quot;tcp&quot;</code> 时，仅会接收 TCP 流量。默认值为 <code>&quot;tcp&quot;</code>。</p><blockquote><p><code>timeout</code>: number</p></blockquote><p>连接空闲的时间限制。单位为秒。默认值为 <code>300</code>。处理一个连接时，如果在 <code>timeout</code> 时间内，没有任何数据被传输，则中断该连接。</p><blockquote><p><code>followRedirect</code>: true | false</p></blockquote><p>当值为 <code>true</code> 时，dokodemo-door 会识别出由 iptables 转发而来的数据，并转发到相应的目标地址。</p>',15),d=l("可参考 "),i=l("传输配置"),b=l(" 中的 "),k=s("code",null,"tproxy",-1),q=l(" 设置。"),m=s("blockquote",null,[s("p",null,[s("code",null,"userLevel"),l(": number")])],-1),f=l("用户等级，连接会使用这个用户等级对应的 "),h=l("本地策略"),y=l("。"),g=l("userLevel 的值, 对应 "),j=l("policy"),v=l(" 中 "),x=s("code",null,"level",-1),w=l(" 的值. 如不指定, 默认为 0。"),L=s("h2",{id:"透明代理配置样例",tabindex:"-1"},[s("a",{class:"header-anchor",href:"#透明代理配置样例","aria-hidden":"true"},"#"),l(" 透明代理配置样例")],-1),R=s("p",null,[l("此部分请参考"),s("a",{href:"../../document/level-2/tproxy"},"透明代理（TProxy）配置教程"),l("。")],-1);u.render=function(c,l){const u=o("RouterLink");return e(),n(p,null,[r,s("p",null,[d,a(u,{to:"/config/transport.html#sockoptobject"},{default:t((()=>[i])),_:1}),b,k,q]),m,s("p",null,[f,a(u,{to:"/config/policy.html#levelpolicyobject"},{default:t((()=>[h])),_:1}),y]),s("p",null,[g,a(u,{to:"/config/policy.html#policyobject"},{default:t((()=>[j])),_:1}),v,x,w]),L,R],64)};export default u;
